package com.edubridge.jumpingstatements;
//break and continue
public class BreakStatementDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1;i<=10;i++)
		{
			//System.out.println(i);
			if(i==5)
				break;
				//continue;
			System.out.println(i);
		}
		
			

	}

}